#!/bin/bash

source assert.sh
make || exit 1

fail=0
optm=0
pass=0

test_optm()
{
	(($1 <= $2)) && return 0
	echo -e ${YELLOW}"âœ– Case with args '$3' may need optimization: $1/$2 moves used\n"
	((pass--))
	((optm++))
}

test_assert()
{
	assert_eq "$1" "OK" "Failed with args '$2'" && ((++pass)) && return 0
	((fail++))
}

test_act()
{
	local ops=$(./push_swap $1)
	local check="$(echo "$ops" | ./checker_linux $1 2>/dev/null)"

	[ -z $check ] && [ $2 == 0 ] && check="OK"

	test_assert $check "$1"

	[ $check == "OK" 2>/dev/null ] && test_optm $(echo "$ops" | wc -w) $2 "$1"
}


